$rootDir = opendir(".");                    // open current directory
$dirArray = [];

while($element = readdir($rootDir)) {       // get each entry
    // exclude files and hidden folders
    if (is_dir($element) && (substr($element, 0, 1) != ".")) {
        $dirArray[] = $element;
    }
}

closedir($rootDir);                         // close directory
$projectCount = count($dirArray) ;          // count elements in array
if ($projectCount > 0) {                    // sort 'em
    sort($dirArray);
}
?>
<body>
<div class="content">
    <div class="new-apple-logo"></div>
    <span> <?php echo ($projectCount > 0)? $projectCount : "No"; ?> Projects</span>
    <ul class="sites">
        <li><br/></li>
        <?php if ($projectCount > 0) : ?>
            <?php foreach ($dirArray as $dir):?>
                <li><a href="<?php echo $dir ;?>"><?php echo $dir ;?></a></li>
            <?php endforeach; ?>
        <?php else: ?>
            <li><a href="#">Nothing here, Let's start create something!</a></li>
        <?php endif; ?>
    </ul>
</div>
</body>
